      zprivatizov&aacute;ny. Pro vět&scaron;&iacute; bezpečnost v problematik&yacute;ch
      č&aacute;stech Prahy 14 prosazuj&iacute; Svobodn&iacute; v&iacute;ce str&aacute;žn&iacute;ků
      Městsk&eacute; policie v ulic&iacute;ch. Vn&iacute;m&aacute;me i nutnost ře&scaron;en&iacute;
